-- ----------------------------
--  Table structure for `hw_account_log`
-- ----------------------------
DROP TABLE IF EXISTS `hw_account_log`;
CREATE TABLE `hw_account_log` (
  `ACCOUNT_LOG_ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `ACCOUNT_ID` bigint(20) DEFAULT NULL,
  `REAL_PAY` bigint(32) DEFAULT NULL COMMENT '支出金额  以厘为单位',
  `LOG_TYPE` char(2) DEFAULT NULL COMMENT '类型  0:支付 1：充值',
  `INCOME` bigint(32) DEFAULT NULL COMMENT '收入  以厘为单位',
  `ORDER_ID` bigint(18) DEFAULT NULL COMMENT '库存订单',
  `AGENT_ORDER_ID` bigint(128) DEFAULT NULL COMMENT '代理商订单',
  `BLANK_SERIAL_NUMBER` varchar(128) DEFAULT NULL COMMENT '银行流水号',
  `CREATETIME` datetime DEFAULT NULL COMMENT '创建时间',
  `LOG_STATUS` varchar(1) DEFAULT NULL COMMENT '操作状态 0：待处理 1：成功 2：失败',
  `TIBCO_SN` varchar(25) DEFAULT NULL COMMENT 'TIBCO操作流水号',
  `CREATOR` bigint(20) DEFAULT NULL COMMENT '创建人',
  `FAIL_REASON` varchar(200) DEFAULT NULL COMMENT '失败原因',
  PRIMARY KEY (`ACCOUNT_LOG_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1841 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

