-- ----------------------------
--  Table structure for `hw_file_upload`
-- ----------------------------
DROP TABLE IF EXISTS `hw_file_upload`;
CREATE TABLE `hw_file_upload` (
  `FILE_ID` bigint(8) NOT NULL AUTO_INCREMENT COMMENT '文件标识，通过mapp_file_upload_seq获取',
  `FILE_NAME` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '文件名（实际的文件名称）',
  `FILE_PATH` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '全路径,路径加序列文件名',
  `FILE_STAT` varchar(1) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '状态(0:标识为提交；1：标识已提交)',
  `FILE_UPLOAD_MAN` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '文件上传人',
  `FILE_MAPPING_ID` bigint(8) DEFAULT NULL COMMENT '对应mapp_app_version的appId',
  `APP_VERSION` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '对应文件的版本',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '文件上传时间',
  `FILE_SIZE` bigint(9) DEFAULT NULL COMMENT '文件大小',
  `OPTR_TYPE` varchar(1) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '操作类型(0:上传;1:删除)',
  `PATH_ID` varchar(80) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '路径标识(与mapp_sys_param里对应)',
  `USE_DOMAIN` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '使用域',
  `FILE_TYPE` varchar(16) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '文件类型',
  `FILE_INDEX` varchar(80) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '展示排序',
  `FILE_COMMENT` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '文件描述',
  `FILE_EXT` char(2) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '文件格式   01：图片；02：附件',
  `FILE_LENGTH` int(9) DEFAULT NULL COMMENT '图片长',
  `ORIGID` int(8) DEFAULT NULL,
  `FILE_WIDTH` int(9) DEFAULT NULL COMMENT '图片宽',
  `FILE_SYSTEM` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`FILE_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=565657 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

