DROP TABLE IF EXISTS `hw_order_shipment`;
CREATE TABLE `hw_order_shipment` (
  `order_ship_id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `order_id` bigint(16) DEFAULT NULL COMMENT '订单ID',
  `order_code` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '订单号',
  `express_number` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '快递运单号',
  `express_company_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '快递公司编号',
  `express_company_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '快递公司名称',
  `ship_type` int(2) DEFAULT NULL COMMENT '发货方式 1-快递 2-其它',
  `sender` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '发件人',
  `sender_company_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '发件单位名称',
  `sender_address` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '发件地址',
  `sender_tel` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '发件联系电话',
  `sender_comment` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '发件备注',
  `recipient` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '收件人',
  `recipient_company_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '收件人单位名称',
  `recipient_address` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '收件地址',
  `recipient_tel` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '收件联系电话',
  `rejector` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '退货人',
  `reject_comment` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '退货备注',
  `ship_status` int(2) DEFAULT NULL COMMENT '运单状态',
  `creator` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`order_ship_id`)
) ENGINE=InnoDB AUTO_INCREMENT=114 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT COMMENT='订单运单表';

